class Solution(object):
    def rotate(self, s, t):
        """
        :type nums: List[int]
        :type k: int
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        a = [x for x in s]
        b = [y for y in t]

        if set(a) == set(b):
            d = dict()
            e = dict()
            for i in set(a):
                d[i] = a.count(i)

                e[i] = b.count(i)

                if d[i] != e[i]:
                    return i
        else:
            if len(set(a)) > len(set(b)):
                return list(set(a) - set(b))[0]
            else:
                return list(set(b) - set(a))[0]

s=""
t=""


n = Solution()
print(n.rotate(s,t))